SELECT FILTER.IDP_DATA_DATE, FILTER.DEFAULT_ID, FILTER.DEFAULT_DATE, FILTER.DEFAULT_CATEGORY_ID, FILTER.SRC_APP_ID, FILTER.UEN, FILTER.UBN, FILTER.FACILITY_ID, FILTER.APMS_ID, FILTER.FAC_ID, FILTER.COMC_FACILITY_ID, FILTER.RES_TYPE_ID, CAST(MAIN.CO as decimal(23,2)) as CO, CAST(MAIN.ADV_OUTFLOW as decimal(23,2)) as ADV_OUTFLOW, F_OAD.F_OAD, F_OAD.STAT_TYPE_ID, CAST((F_OAD.F_OAD + MAIN.ADV_OUTFLOW - MAIN.CO) as decimal(23,2)) AS CO_DIFF FROM ( SELECT A.IDP_DATA_DATE, A.DEFAULT_ID,A.DEFAULT_CATEGORY_ID, A.DEFAULT_DATE, B.RES_TYPE_ID, B.FACILITY_ID, B.APMS_ID, B.FAC_ID, B.COMC_FACILITY_ID, C.UEN, C.UBN, C.SRC_APP_ID FROM CCDM.V_L1_CCDM_DEFAULTS AS A LEFT OUTER JOIN CCDM.V_L1_CCDM_FACILITY AS B ON A.IDP_DATA_DATE = B.IDP_DATA_DATE AND A.DEFAULT_ID = B.DEFAULT_ID LEFT OUTER JOIN ( ( SELECT IDP_DATA_DATE, PORTFOLIO_ID, UEN, UBN, SOURCE_SYSTEM_IND, SRC_APP_ID FROM CCDM.V_L1_CCDM_ARCHIVEDPORTFOLIOS WHERE IDP_DATA_DATE = (SELECT MAX(IDP_DATA_DATE) FROM CCDM.V_L1_CCDM_ARCHIVEDPORTFOLIOS) ) UNION ( SELECT IDP_DATA_DATE, PORTFOLIO_ID, UEN, UBN, SOURCE_SYSTEM_IND, SRC_APP_ID FROM CCDM.V_L1_CCDM_PORTFOLIOS WHERE IDP_DATA_DATE = (SELECT MAX(IDP_DATA_DATE) FROM CCDM.V_L1_CCDM_PORTFOLIOS)
)
) AS C ON A.IDP_DATA_DATE = C.IDP_DATA_DATE AND A.PORTFOLIO_ID = C.PORTFOLIO_ID
WHERE A.IDP_DATA_DATE = (SELECT MAX(IDP_DATA_DATE) FROM CCDM.V_L1_CCDM_DEFAULTS) )FILTER LEFT JOIN ( select C.IDP_DATA_DATE, C.FACILITY_ID, SUM (Case when c.CASH_APPLIED_ID in ('28') then c.CASH_AMT end) as ADV_OUTFLOW, SUM (Case when c.CASH_APPLIED_ID in ('26') then c.CASH_AMT end) as CO --SUM ( Case when c.CASH_APPLIED_ID NOT IN ( 26, 28) then coalesce (c.CASH_AMT,0) else 0 end) as OTHER from CCDM.V_L1_CCDM_FACILITY_CASHFLOW C WHERE C.IDP_DATA_DATE = (SELECT MAX (IDP_DATA_DATE) FROM CCDM.V_L1_CCDM_FACILITY_CASHFLOW) group by 1,2 )MAIN ON FILTER.IDP_DATA_DATE = MAIN.IDP_DATA_DATE AND FILTER.FACILITY_ID = MAIN.FACILITY_ID LEFT JOIN ( SELECT IDP_DATA_DATE, FACILITY_ID, OUTSTANDING_AMT, NVL(OUTSTANDING_AMT,0) as F_OAD, STAT_TYPE_ID FROM CCDM.V_L1_CCDM_FACILITY_VALUES WHERE IDP_DATA_DATE = (SELECT MAX(IDP_DATA_DATE) FROM CCDM.V_L1_CCDM_FACILITY_VALUES) AND STAT_TYPE_ID = 3 )F_OAD ON FILTER.IDP_DATA_DATE = F_OAD.IDP_DATA_DATE AND FILTER.FACILITY_ID = F_OAD.FACILITY_ID WHERE FILTER.DEFAULT_CATEGORY_ID NOT IN ( '90', '13', '15', '25', '3','9', '10', '11', '12', '14', '16', '17', '20', '21', '26', '27' ) AND SUBSTRING(FILTER.FAC_ID,1,3) <> 'LN-' AND MAIN.CO>0
